import React from 'react';
import './settings.css'
import SettingsCard from './SettingsCard/SettingsCard.js';

displayLang = (lang) => {
	console.log(lang);
}

const Settings = () => {
	return (
		<div>
			<SettingsCard languageChange={this.displayLang}/>
		</div>

	);
}

export default Settings;
